"1566 :   private void checkInterfaceConflictProperties(NodeTraversal t, Node n,
1567 :       String functionName, HashMap<String, ObjectType> properties,
1568 :       HashMap<String, ObjectType> currentProperties,
1569 :       ObjectType interfaceType) {
1570 :     ObjectType implicitProto = interfaceType.getImplicitPrototype();
1571 :     Set<String> currentPropertyNames;
1572 :       // This can be the case if interfaceType is proxy to a non-existent
1573 :       // object (which is a bad type annotation, but shouldn't crash).
1574 :       currentPropertyNames = implicitProto.getOwnPropertyNames();
1575 :     for (String name : currentPropertyNames) {
1576 :       ObjectType oType = properties.get(name);
1577 :       if (oType != null) {
1578 :         if (!interfaceType.getPropertyType(name).isEquivalentTo(
1579 :             oType.getPropertyType(name))) {
1580 :           compiler.report(
1581 :               t.makeError(n, INCOMPATIBLE_EXTENDED_PROPERTY_TYPE,
1582 :                   functionName, name, oType.toString(),
1583 :                   interfaceType.toString()));
1584 :         }
1585 :       }
1586 :       currentProperties.put(name, interfaceType);
1587 :     }
1588 :     for (ObjectType iType : interfaceType.getCtorExtendedInterfaces()) {
1589 :       checkInterfaceConflictProperties(t, n, functionName, properties,
1590 :           currentProperties, iType);
1591 :     }
1592 :   }"

